O MUNDO PRECISA SABER

*TODO EL PROCESO FUE ILEGÍTIMO*

Vea cómo sucedió todo en 16 actos a continuación...

El fraude fue *sistémico*. No fue solo en la urna y no solo en el cálculo, sino en *TODO EL PROCESO*, desde el principio. Lula era solo una parte de ese sistema.

*ACTO 1.* El 21/03/19, un grupo de jueces y juezas federales viajó a Curitiba para expresar apoyo y solidaridad con el entonces encarcelado Lula, participando en la llamada “vigilia Lula libre”. * ¿Alguna vez has visto una oferta así? ¿Los jueces sensibilizan a un ladrón en la cárcel?* Vean el desenlace que todo esto tendría;

*ACTO 2.* Para derrocar a Bolsonaro, se necesitaba un oponente fuerte. Por eso sacaron a Lula de la cárcel, anularon su condena y le devolvieron sus derechos políticos, haciéndolo elegible;

*ACT 3.* Impidieron cualquier acción que garantizara la transparencia en la votación y el escrutinio, el tan discutido *voto auditable.* Destacó la visita de los ministros Barroso y Alexandre de Moraes a la cámara federal para presionar el canje de presidentes de comisión, lo que fue decisivo para que el proyecto no se aprobara. Ese día quedó registrado aquel triste pasaje con el eternizado discurso *"La elección no se gana, se toma";*

*ACT 4.* Ampliaron el poder del TSE, concentrando la autoridad en manos de un solo hombre: Alexandre de Moraes. La ministra Carmen Lúcia lo dejó para la historia, *en una votación reciente, reconociendo la inconstitucionalidad de la censura, pero se lavó las manos.* Ni siquiera ella tuvo fuerzas para ir contra el Sistema;

*ACT 5.* Todavía no sabemos cómo, pero el Sistema silenció/amordazó a los *Ministros Nunes Marques y André Mendonça;*

* ACTO 6.* Alexandre de Moraes aseguró que la propaganda electoral en la radio (fundamental sobre todo en el Nordeste) fue amañada en * beneficio de Lula, en al menos 154 mil inserciones menos para Bolsonaro;*

*ACTO 7.* Globo, Estadão, Folha y UOL crearon y lideraron un *pool de periodismo y medios favorables a Lula, garantizando las 24 horas del día propaganda y mentiras contra Bolsonaro;*

*ACTO 8.* Alexandre de Moraes lideró una amplia red de vigilancia contra la buena información, realizando censura previa a los medios de comunicación, decretando detenciones oficiales, desmonetización de canales y persecución de activistas y simpatizantes de Bolsonaro. *El joven Pan vivió días de censura;*

*ACT 9.* La Corte Electoral en algunos estados comenzó a patrullar a los votantes, observando y ordenando la remoción de carteles y calcomanías. *Incluso nuestras camisetas y la bandera de Brasil tenían su uso restringido;*

*ACTO 10.* Si bien la campaña de Bolsonaro fue restringida en muchos de sus discursos, Lula se mantuvo libre, haciendo todo lo que Bolsonaro no podía hacer, *incluida la visita a manifestaciones con narcotraficantes armados en RJ;*

*ACT 11.* Alexandre de Moraes asumió el activismo político judicial al "servicio del PT", respondiendo a todas y cada una de las solicitudes de la campaña del PT y negando casi siempre las solicitudes de Bolsonaro, lo que perjudicó mucho la campaña del presidente.

*ACT 12.* A Bolsonaro y sus medios se les prohibió incluso decir verdades como, por ejemplo: Lula fue condenado, Lula no fue absuelto, Lula tiene vínculos con facciones criminales e incluso decir que Lula era el jefe de una organización criminal;

*ACT 13.* Se impidió a la PM realizar operaciones contra narcotraficantes, se impidió a la PRF concretar salidas y compra de votos, se impidió a la PF investigar encuestas fraudulentas;

*ACT 14.* Los institutos de investigación *manipularon los números a su antojo, con un amplio y poderoso apoyo de los principales medios de comunicación*, lo que sin duda tuvo un gran impacto en la votación, especialmente en la primera vuelta;

*ACT 15.* Se cercenó el derecho a la libertad de expresión de los medios y redes sociales, se vigilaron, se desmonetizaron canales, se bloquearon cuentas, se silenció a influencers, periodistas y reporteros (CENSURADOS);

